import React from "react";  
import { useNavigate } from "react-router";

const navigate = useNavigate();
const style={
    color:"black"
};

const logOut= ()=>{
    navigate('/',{state: {isLogin:false}})
}

export default function LoginHead(){
    return(
        <div style={style}>
            Login Success..!
            <button onClick={logOut}>LogOut</button>
        </div>
    );
}
